import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function BasicTextFields() {


  return (
    <Box
      component="form"
      ssx={{ position: 'absolute', bottom: 16, right: 16 }}
      noValidate
      autoComplete="off"


    >
      <TextField id="filled-basic" label="Standard" variant="standard" sx={{color: 'red'}}/>
    </Box>
  );
}
